import '../../css/Login.css';
import SignUp from './SignUp';
import ForgotPassword from './ForgotPassword';

function handleClick() {

}

function Login(props) {
    return(
        <div className="login">
            <h2 id='siginId'>Sign-in</h2>
            <form class='loginContainer'>

                <div className='formContainer'>
                    <div>
                        <label className='inputLabel'>Email <span className='asterick'>*</span></label><br></br>
                        <input className='inputArea' type="email" required></input>
                    </div>
                    <div>
                        <label className='inputLabel'>Password <span className='asterick'>*</span></label><br></br>
                        <input className='inputArea' type="password" required></input>
                    </div>
                    <div className='FO'>
                        <button type="button" className='forgotpwd , buttonLink'
                        onClick={handleClick}> Forgot Password? </button>
                    </div>
                    <div className='submitDiv'>
                        <button type="submit" className="submitButton">LOG IN</button>
                    </div>
                    <div className='labelAndSignUp'>
                        Don't have an account?
                        <button type="button" className='signUp , buttonLink'>Sign up</button>
                    </div>
                </div>
            </form>
        </div>
    );
}
export default Login;
